Le golfe Persique est un golfe de l'océan Indien qui s'étend sur 251 000 km2. Il sépare l'Iran (l'ancienne Perse) de la péninsule arabique. Les pays qui le bordent sont : 
* l'Iran au nord-est ; 
* Oman : quelques kilomètres de côtes avec l'enclave de Moussandam à l'est ; 
* les Émirats arabes unis au sud-est ; 
* le Qatar au sud ; 
* Bahreïn au sud-ouest ; 
* l'Arabie saoudite à l'ouest, 
* l'Irak et le Koweït au nord-ouest ; À l'est, il communique avec le golfe d'Oman par le détroit d'Ormuz, lequel est inclus en totalité dans le golfe Persique.

